INSERT INTO `sys_lists` VALUES (1,'2017-09-28 12:57:19','2017-09-29 15:30:11','127.0.0.1','company_section_2','doi ngu tu van ky thuat','left',1,0),(2,'2017-09-28 12:57:28','2017-09-29 15:32:20','127.0.0.1','company_section_2','chuyen nghiep giau kinh nghiem','left',2,0),(3,'2017-09-28 12:57:35','2017-09-29 15:34:05','127.0.0.1','company_section_2','doi tac tin cay','left',3,0),(4,'2017-09-28 12:57:47','2017-09-29 15:27:36','127.0.0.1','company_section_2','san pham va dich vu cao','right',1,0),(5,'2017-09-28 12:57:54','2017-09-29 15:26:12','127.0.0.1','company_section_2','gia tri khach hang la cot loi','right',2,0),(6,'2017-09-28 12:58:02','2017-09-29 14:07:15','127.0.0.1','company_section_2','giao hang dung tien do','right',3,0),(7,'2017-09-28 13:03:36','2017-09-29 15:51:38','127.0.0.1','company_section_3','su menh','mo ta cho muc su menh o tab cong ty',1,0),(8,'2017-09-28 13:04:29','2017-09-29 15:47:29','127.0.0.1','company_section_3','kinh nghiem','mo ta cho muc kinh nghiem o tab cong ty',2,0),(9,'2017-09-28 13:04:50','2017-09-29 15:42:24','127.0.0.1','company_section_3','dich vu','mo ta cho muc dich vu o tab cong ty',3,0),(10,'2017-09-28 13:33:23','2017-09-28 13:33:23','127.0.0.1','home_section_3','Gia công chính xác','Chúng tôi chuyên gia công chính xác chi tiết máy, gia công chi tiết khuôn, linh kiện-phụ tùng cơ khí ô tô-điện tử và các ngành công nghiệp khác.<br />\nBên cạnh đó chúng tôi áp dụng công nghệ xử lý bề mặt không những mang lại sản phẩm đạt yêu cầu kỹ thuật mà còn đáp ứng về mặt ngoại quan sản phẩm.',1,0),(11,'2017-09-28 13:34:18','2017-09-28 13:34:18','127.0.0.1','home_section_3','Thiết kế, chế tạo máy','Với đội ngũ kỹ sư nhiều kinh nghiệm làm việc trong nhiều lĩnh vực, chúng tôi đưa ra các giải pháp công nghệ kỹ thuật từ đó thiết kế chế tạo máy theo nhu cầu của khách hàng.<br />\nNhững sản phẩm tưởng như không thể, phức tạp khi đến với chúng tôi sẽ đơn giản và tối ưu nhất.',2,0),(12,'2017-09-28 13:34:48','2017-09-28 13:34:48','127.0.0.1','home_section_3','Dịch vụ của chúng tôi','Với phương châm mang lại sự hài lòng cho khách hàng.<br />\nSản phẩm của chúng tôi được kiểm tra nghiêm ngặt từ khâu đầu vào, quá trình sản xuất cho tới khâu kiểm định,  đóng gói và vận chuyển để mang lại sản phẩm đạt chất lượng và đáp ứng nhanh tiến độ.',3,0),(13,'2017-09-28 13:37:18','2017-09-28 13:37:18','127.0.0.1','home_section_4','Chúng tôi phục vụ các nhu cầu chế tạo','left',1,0),(14,'2017-09-28 13:37:32','2017-09-28 13:37:32','127.0.0.1','home_section_4','Các dịch vu gia công cơ khí chính xác,  thiết kế chế tạo của chúng tôi đáp ứng nhu cầu của nhiều ngành công nghiệp với quy mô lớn và nhỏ.','left',2,0),(15,'2017-09-28 13:37:41','2017-09-28 13:37:41','127.0.0.1','home_section_4','Ngoài ra chúng tôi còn đáp ứng nhanh tiến độ theo từng yêu cầu của khách hàng.','left',3,0),(16,'2017-09-28 13:37:54','2017-09-28 13:37:54','127.0.0.1','home_section_4','Với sự chuyên nghiệp, giàu kinh nghiệm và tận tâm sẽ mang lại sự hài lòng cho khách hàng.','right',1,0),(17,'2017-09-28 13:38:03','2017-09-28 13:38:03','127.0.0.1','home_section_4','Chúng tôi tự hào mang lại chất lượng sản phẩm và dịch vụ cao nhất cho khách hàng.','right',2,0),(18,'2017-09-28 13:38:11','2017-09-28 13:38:11','127.0.0.1','home_section_4','Hãy liên hệ với chúng tôi nếu như bạn có nhu cầu cũng như bất kỳ câu hỏi nào.','right',3,0),(19,'2017-09-28 13:58:00','2017-09-28 13:58:00','127.0.0.1','product_section_3','Gia công chi tiết máy.','left',1,0),(20,'2017-09-28 13:58:21','2017-09-28 13:58:21','127.0.0.1','product_section_3','Gia công khuôn mẫu.','left',2,0),(21,'2017-09-28 13:58:28','2017-09-28 13:58:28','127.0.0.1','product_section_3','Sản xuất, lắp đặt.','left',3,0),(22,'2017-09-28 13:58:40','2017-09-28 13:58:40','127.0.0.1','product_section_3','Cho thuê máy công cụ.','left',4,0),(23,'2017-09-28 13:58:55','2017-09-28 13:58:55','127.0.0.1','product_section_3','Thiết kế và chế tạo máy tự động hóa.','right',1,0),(24,'2017-09-28 13:59:03','2017-09-28 13:59:03','127.0.0.1',